script: |
  super -f text -I q9922.spq | sort > q9922.out

inputs:
  - name: q9922.spq
    data: |
      SELECT ALL + + col2 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE + col2 * - - 38 * - 61 NOT IN ( + 89, + ( 32 ) * - 8 + + col2 * - 99 + - - 91 );
  - name: tab0

outputs:
  - name: q9922.out
    data: |
      10
      47
      99
